def get_weather(wdata, day):
    lst = [ ]
    if day <0 or day > len(wdata)-1:
        return "Day " + str(day) + " is invalid!"
    else:
        for i in range(len(wdata)): 
            lst = lst + [wdata[i][day]]
        return lst

